    useEffect(() => {
        axios
            .delete('http://localhost:8989/deleteStudent?'+roll)
            .then((response) => {
                console.log(response.data);
            })
            // .catch((error) => setIsError(error.message));
    }, []);
return (  
<>
<input type="number" placeholder='Enter Roll Number' value={roll} onChange={(e)=>setRoll(e.target.value)}>

</input>
</>
);
}

export default Delete;
